        private TTFFont noto;

        private Character[] textBufferNext, textBufferLast;

        private Canvas canvas;
        private CGSSurface surface;

        /// <summary>
        /// The purpose of this field is to store a local map of already rendered characters.
        /// Once a char has been rendered, the result is stored here for faster re-use. The
        /// int is the ascii table index.
        /// </summary>
        private Dictionary<int, GlyphResult> fontCache;

        /// <summary>
        /// A list of functions that need to be executed in sequence inside our render loop.
        /// </summary>
        private List<Action> renderQueue;

        #endregion

        #region Public properties

        /// <summary>
        /// Actual size of the virtual screen in pixels. Use <see cref="Grid"/> instead for text.
        /// </summary>
        public (uint Width, uint Height) Screen { get; private set; }

        public (int Width, int Height) Grid { get; private set; }

        public int TextWidth { get; private set; }
        public int TextHeight { get; private set; }
        public int TextKerning { get; private set; }
        public int TextLsb { get; private set; }
        public int TextPadding { get; private set; }

        public Cursor Cursor { get; private set; }

        /// <summary>
        /// Height (in px) of the bottom status bar.
        /// </summary>
        public uint StatusBarHeight { get; private set; }
        public int FontSize { get; private set; }

        #endregion

        /// <summary>
        /// The Chromat is a fullscreen graphical terminal. It manages various things like cursor
        /// position, font, color and many more things.
        /// </summary>
        /// <param name="width">Actual screen-space width in pixel.</param>
        /// <param name="height">Actual screen-space height in pixel.</param>
        /// <param name="statusBarHeight">(unused right now)</param>
        /// <param name="fontSize">Size of each letter in pixel (a value of 16 results to 8x8 letters))</param>
        /// <param name="pad">Size of padding around each letter for better readability.</param>
        public Chromat(uint width = 800, uint height = 600, uint statusBarHeight = 8, int fontSize = 16, int pad = 1)
        {
            Screen = (width, height);
            StatusBarHeight = statusBarHeight;
            FontSize = fontSize;
            Cursor = new Cursor(this);

            noto = new TTFFont(Convert.FromBase64String(ttfFont));

            TextPadding = pad;
            TextWidth = noto.CalculateWidth("A", FontSize);

            // Since we're doing monospace here, the size and kerning of each char should stay the same.
            // So we don't need to repeat this calculation for each char, however this should be done
            // for sans and sans-serif fonts later.
            foreach (Rune r in "A".EnumerateRunes())
            {
                noto.GetGlyphHMetrics(r, FontSize, out int advWidth, out int lsb);
                noto.GetKerning(r, "B".EnumerateRunes().First(), FontSize, out int kerning);
                TextHeight = advWidth;
                TextLsb = lsb;
                TextKerning = kerning;
            }

            Kernel.PrintDebug($"Font loaded. Metrics: {TextWidth}x{TextHeight} px");

            Grid = ((int)Screen.Width / (TextWidth + TextPadding / 2), (int)Screen.Height / (TextHeight + TextPadding / 2));
            Kernel.PrintDebug($"Generate grid of {Grid.Width}x{Grid.Height} with {TextPadding}px padding ({Grid.Width * Grid.Height} cells) ...");
            textBufferNext = new Character[Grid.Width * Grid.Height];
            textBufferLast = new Character[Grid.Width * Grid.Height];
            Kernel.PrintDebug("Grid generated.");

            renderQueue = new();
            renderQueue.Add(() =>
            {
                for (int row = 0; row < Grid.Height; row++)
                {
                    for (int col = 0; col < Grid.Width; col++)
                    {
                        int i = (row * Grid.Width) + col;

                        if (textBufferNext[i] == null)
                            continue;

                        // Skip draw if character at this position remains unchanged.
                        if (textBufferLast[i] != null && textBufferLast[i].Symbol == textBufferNext[i].Symbol)
                            continue;

                        int x = (col * TextPadding) * TextWidth;
                        int y = (row * TextPadding) * TextHeight;

                        DrawCharacter(surface, FontSize, x, y, textBufferNext[i].Symbol.ToString(), textBufferNext[i].ForegroundColor);
                    }
                }

                // Copy the last rendered frame to optimize draw calls above.
                Array.Copy(textBufferNext, textBufferLast, Grid.Width * Grid.Height);
            });

            fontCache = new();
            canvas = FullScreenCanvas.GetFullScreenCanvas(new Mode(Screen.Width, Screen.Height, ColorDepth.ColorDepth32));
            surface = new CGSSurface(canvas);

            Kernel.PrintDebug("Chromat initialized.");
        }

        public void Loop()
        {
            int iteration = 0;
            while (true)
            {
                long beginRender = DateTime.Now.Ticks / TimeSpan.TicksPerMillisecond;
                //canvas.Clear(Color.Blue);

                Color color;
                if (iteration % 10 == 0)
                {
                    color = Color.Pink;
                }
                else
                {
                    color = Color.Purple;
                }

                DrawText("THE END IS NEVER ", color);

                // Sequentially work though our render queue.
                renderQueue.ForEach(x => x());

                canvas.Display();
                long endRender = DateTime.Now.Ticks / TimeSpan.TicksPerMillisecond;
                long deltaTime = endRender - beginRender;
                iteration++;

                //Kernel.PrintDebug($"Rendering {renderQueue.Count} queue objects took {deltaTime}ms");
            }
        }

        /// <summary>
        /// Removes the top most line and moves all other entries up by `lines`.
        /// </summary>
        /// <param name="lines">How many lines should be scrolled at once.</param>
        public void ScrollDown(int lines = 1)
        {
            ForceRedraw();

            int totalCharacters = Grid.Width * Grid.Height;

            // Shift all rows up by one
            for (int i = 0; i < totalCharacters - Grid.Width; i++)
            {
                textBufferNext[i] = textBufferNext[i + Grid.Width];
            }

            // Clear the last row (fill with spaces or your preferred empty character)
            for (int i = totalCharacters - Grid.Width; i < totalCharacters; i++)
            {
                textBufferNext[i] = null; // Or any character representing "empty"
            }
        }

        public void ForceRedraw()
        {
            // Clear screen
            canvas.Clear();

            // Clear local buffer by replacing it with a fresh array.
            this.textBufferLast = new Character[Grid.Width * Grid.Height];

            // Our render pipeline will redraw everything on the next run.
        }

        public void DrawText(string text, Color foregroundColor)
        {
            //Kernel.PrintDebug($"Print {foregroundColor} \"{text}\" to the screen at {Cursor.Position.X}x{Cursor.Position.Y}");

            for (int i = 0; i < text.Length; i++)
            {
                this.textBufferNext[Cursor.LinearCursorPosition + i] = new()
                {
                    Symbol = text[i],
                    BackgroundColor = foregroundColor,
                    ForegroundColor = foregroundColor,
                };
            }

            Cursor.MoveHorizontal(text.Length);
        }

        /// <summary>
        /// Custom implementation of <seealso cref="TTFFont.DrawToSurface(ITTFSurface, int, int, int, string, Color)"/> to include
        /// caching of bitmaps to speed up rendering.
        /// </summary>
        private void DrawCharacter(ITTFSurface surface, int px, int x, int y, string text, Color color)
        {
            int offX = 0;

            Rune prevRune = new Rune('\0');

            foreach (Rune c in text.EnumerateRunes())
            {
                // Try to get glyph (and with it its bitmap) from cache, or else render.
                if (!fontCache.TryGetValue(c.Value, out GlyphResult g))
                {
                    GlyphResult? gMaybe = noto.RenderGlyphAsBitmap(c, color, px);
                    if (!gMaybe.HasValue) continue;

                    g = gMaybe.Value;
                    fontCache.Add(c.Value, g);
                }

                offX += TextLsb + TextKerning;
                surface.DrawBitmap(g.bmp, x + offX, y + g.offY);

                if (TextKerning > 0)
                    offX -= TextLsb;
                else
                    offX += TextHeight - TextLsb;

                prevRune = c;
            }
        }

    }
}
